import { NavigationContainer, DefaultTheme, DarkTheme } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import * as React from 'react';
import { ColorSchemeName } from 'react-native';

import NotFoundScreen from '../screens/NotFoundScreen';
import { RootStackParamList } from '../types';
import BottomTabNavigator from './BottomTabNavigator';
import LinkingConfiguration from './LinkingConfiguration';
import { Button, View } from 'react-native';
import { createDrawerNavigator } from '@react-navigation/drawer';
import TabOneScreen from '../screens/TabOneScreen';

// If you are not familiar with React Navigation, we recommend going through the
// "Fundamentals" guide: https://reactnavigation.org/docs/getting-started
export default function Navigation({ colorScheme }: { colorScheme: ColorSchemeName }) {
  return (
    <NavigationContainer
      linking={LinkingConfiguration}
      theme={colorScheme === 'dark' ? DarkTheme : DefaultTheme}>
      <RootNavigator />
    </NavigationContainer>
  );
}

// A root stack navigator is often used for displaying modals on top of all other content
// Read more here: https://reactnavigation.org/docs/modal
const HomeStack = createStackNavigator<RootStackParamList>();
const DetailsStack = createStackNavigator<RootStackParamList>();
const Drawer = createDrawerNavigator();

function HomeScreen({ navigation }: any) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Button
        onPress={() => navigation.openDrawer()}
        title="Open Side Menu"
      />
    </View>
  );
}

function DetailsScreen({ navigation }: any) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Button onPress={() => navigation.goBack()} title="Go back home" />
    </View>
  );
}


function HomeStackScreen({ navigation }: any) {
  return (
    <HomeStack.Navigator screenOptions={{ headerStyle: {
      backgroundColor: '#009387'
    },
    headerTintColor: '#fff',
    headerTitleStyle:
    {
      fontWeight: 'bold'
    }
    }}>
      <HomeStack.Screen name="Root" component={HomeScreen} options ={{
        title: 'Overview'
      }} />
      <HomeStack.Screen name="NotFound" component={DetailsScreen} options={{ title: 'Oops!' }} />
    </HomeStack.Navigator>
  );
}


function DetailsStackScreen({ navigation }: any) {
  return (
    <DetailsStack.Navigator screenOptions={{ headerStyle: {
      backgroundColor: '#009387'
    },
    headerTintColor: '#fff',
    headerTitleStyle:
    {
      fontWeight: 'bold'
    }
    }}>
      <DetailsStack.Screen name="Root" component={HomeScreen}
       />
      <DetailsStack.Screen name="NotFound" component={DetailsScreen} options={{ title: 'Oops!' }} />
    </DetailsStack.Navigator>
  );
}


function RootNavigator() {
  return (

    <Drawer.Navigator initialRouteName="Home">
        <Drawer.Screen name="Home" component={HomeStackScreen} />
        <Drawer.Screen name="Details" component={DetailsStackScreen} />
        <Drawer.Screen name="Not Found Screen" component={NotFoundScreen} />
      </Drawer.Navigator>

   /* <Stack.Navigator screenOptions={{ headerShown: false }}>
      <Stack.Screen name="Root" component={BottomTabNavigator} />
      <Stack.Screen name="NotFound" component={NotFoundScreen} options={{ title: 'Oops!' }} />
    </Stack.Navigator>*/
  );
}
